// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity ^0.8;


contract NftAuction  {

    struct Auction {
        address seller;
        //起始价格
        uint256 startPrice;
        uint256 duration;
        //拍卖开始时间
        uint256 startTime;

        //最高出价者
        address highestBidder;
        //最高出价
        uint256 highestBid; 
        bool ended; //是否结束
    }

    //拍卖品id=>拍卖信息
    mapping(uint256=>Auction) public auctions;
    //下一个拍卖品id
    uint256 public nextAuctionId;

    //管理员
    address public admin;


    constructor() {
        admin = msg.sender;
    }

    //创建拍卖
    function createAuction( uint256 _startPrice, uint256 _duration) public {
        require(_startPrice > 0, "Start price must be greater than 0");
        require(_duration > 1000*60, "Duration must be greater than 1 minute");
        require(msg.sender == admin,"Only admin can create auction");

        auctions[nextAuctionId] = Auction({
            seller: msg.sender,
            startPrice: _startPrice,
            duration: _duration,
            startTime: block.timestamp,
            highestBidder: address(0),
            highestBid: 0,
            ended: false
        });
        nextAuctionId++;
    }

    //买家参与买单
    function palceBid(uint256 auctionId) external payable {
        Auction storage auction = auctions[auctionId];
        //拍卖未结束
        require(!auction.ended && block.timestamp < auction.startTime + auction.duration, "Auction already ended");
        //出价必须大于最高价格 和 起始价格
        require(msg.value > auction.highestBid && msg.value > auction.startPrice, "Bid must be higher than the current highest bid");

        //如果之前有出价，则返回给之前出价者
        if(auction.highestBidder != address(0)){
            payable(auction.highestBidder).transfer(auction.highestBid);
        }

        auction.highestBidder = msg.sender;
        auction.highestBid = msg.value;

    }
}

